webpackJsonp([0x82254093a257],{3335:function(t,a){t.exports={data:{markdownRemark:{html:"<p><strong>🌡26℃ ☁</strong></p>\n<p>今日から毎週日記を書こうと思いました。</p>\n<p>僕は起きてから一時間ほどして、U 君の家に「ファミコンやって遊ぼう」と言って遊びました。</p>\n<p>その後帰宅して昼食をとったところ、<!-- more -->今度は向こうから U 君が来たので、また少しファミコンを攻略してから、その後映画を見ました。ホームビデオはファミコンよりも珍しいそうです。</p>\n<p>体を動かしたくなったということもあってか、犬の散歩もかねて、U 君と散歩に向かいました。</p>",frontmatter:{cover:null,date:"1990-05-13T21:00:00+09:00",strDate:"1990/5/13",title:"日記"}}},pathContext:{path:"/ja/blog/1990/05/13-diary/",langKey:"ja"}}}});
